Defendant Christopher Monroe in court with attorney Jean M. Kies.  Paul L. Tiffin appeared for the State of Wisconsin.
  Deputy court clerk ccp.
Case set for sentencing hearing. PSI reviewed by parties. Statements made as to sentencing. Letter from the defendant received and filed. Court finds the State has complied with victim rights legislation. 

As to COUNT 1-
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 12 YEARS, with credit for 7 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 4 YEARS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 8 YEARS.  

Defendant is NOT eligible for the Challenge Incarceration Program or the Earned Release Program. The defendant is not appropriate for the Substance Abuse Program.

If revoked, court costs, fees and surcharges be paid through collection by the department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.

Court STAYED the sentence and placed defendant on probation for 8 YEARS with the following conditions:

1) Court ordered 90 days of condition time in the House of Correction, forthwith, with Huber privileges for classes at MATC, work release and release for therapy sessions;
2) Register and comply with the sex offender registry;
3) Obtain/comply with sex offender treatment; 
4) Provide DNA sample (unless previously submitted) and pay surcharge; 
5) Restitution set at ZERO;
6) No contact with the victim or victim's mother Anisha M. Court will allow therapeutic contact between Anisha M. and the defendant. Court will allow therapeutic contact between the victim and defendant with the consent of the victim's mother and the therapist;
7) Pay all costs, fees and surcharges during period of probation. Failure to pay will result in a civil judgment;
8) Cooperate with psychological evaluation upon entering probation;
9) Prohibited from maintaining any social media accounts. Defendant may have an email account;
10) Any electronic devices with internet capabilities to be turned over to agent for inspection upon demand;
11) Report make, model and license plate of vehicle to agent;
12) Continue educational program and maintain current employment;
13) No unsupervised contact with any child under the age of 16 years. Defendant's wife may not be the supervising adult. 
14) Attend cognitive thinking class;

Pursuant to Wisconsin Statutes section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession; Voting 

